	add("nothospecies", "{\"term\":\"nothospecies\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027νόθος\u0027 (bastard) + \u0027species\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A hybrid which is formed by direct hybridization of two species, not other hybrids\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Günter Staudt, \u0027Systematics and Geographic Distribution of the American Strawberry Species: Taxonomic Studies in the Genus Fragaria (Rosaceae: Potentilleae)\u0027, \u0027Botany: Volume 81\u0027, University of California Press, [http://books.google.com.au/books?id\u003dLU29C_V3DNkC\u0026amp;pg\u003dPA32\u0026amp;dq\u003d%22nothospecies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003deMLwUYatMKWXiQeO5YGQDg\u0026amp;ved\u003d0CDUQ6AEwA\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22nothospecies%22\u0026amp;f\u003dfalse page 32\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The fourth species, the \u0027\u0027nothospecies\u0027\u0027 \u0027Fragaria ×ananassa\u0027, was originally established for the hybrids \u0027F. chiloensis\u0027 × \u0027F. virginiana\u0027, which had originated under cultivation and are known as the large-fruited garden strawberries. When the hybrid populations in the coastal regions of northwestern North America were identified as introgressants of the same two octoploid species, they were combined with the cultivated garden strawberries into the \u0027\u0027nothospecies\u0027\u0027 \u0027F. ×ananassa\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, David M. Spooner, \u0027Wild potatoes (Solanum section Petota; Solanaceae) of North and Central America\u0027, [http://books.google.com.au/books?id\u003dxj4lAQAAMAAJ\u0026amp;q\u003d%22nothospecies%22\u0026amp;dq\u003d%22nothospecies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003deMLwUYatMKWXiQeO5YGQDg\u0026amp;ved\u003d0CIkBEOgBMBI page 17\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"For our treatment we designate hybrid species (\u0027\u0027nothospecies\u0027\u0027) by prefix with a multiplication sign placed flush with the species epithet (×; Art H.1.1; H.3A.1 of the \u0027International Code of Botanical Nomenclature\u0027, Greuter et al. 2000) only if they are of restricted distribution and are sympatric with their putative parents\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Arthur Haines, \u0027New England Wild Flower Society\u0027s Flora Novae Angliae: A Manual for the Identification of Native an Naturalized Higher Vascular Plants of New England\u0027, [http://books.google.com.au/books?id\u003dRKKWVwC_sdoC\u0026amp;pg\u003dPR16\u0026amp;dq\u003d%22nothospecies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003deMLwUYatMKWXiQeO5YGQDg\u0026amp;ved\u003d0CFYQ6AEwC\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22nothospecies%22\u0026amp;f\u003dfalse page xvi\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The number that precedes each species is presented to help determine parentage of \u0027\u0027nothospecies\u0027\u0027 (i.e., hybrids). Therefore, all \u0027\u0027nothospecies\u0027\u0027 included in the manual are provided with a numeric formula (e.g., 1 × 3) in addition to the scientific name (when present\", \"priority\":9}]}, \"synonyms\":{}}");

